import './App.css';
import React from 'react';
import { animate, motion } from "framer-motion"; 
import { BsFillArrowLeftCircleFill } from "react-icons/bs";
import { useState } from "react";




function App() {

  let [isOpen, setIsOpen] = useState(false);

  return (


    <div className='nav'style={{overflow:"hidden"}}>
        <motion.div animate={{x:-500}} className="box"> </motion.div>
        <motion.btn layout="position"
        data-isOpen={isOpen}
        style={{overflow:"hidden"}}
        class="menubtn" onClick={() => setIsOpen(!isOpen)}>

          <BsFillArrowLeftCircleFill className='menuicon'/>

        </motion.btn>

        <div className='colum'style={{backgroundColor:"red"}}> </div>
        <div className='colum'> </div>
        <div className='colum'style={{backgroundColor:"blue"}}> </div>
    </div>
  );
}


export default App;
